        items: []
    })

    const [item, setItem] = useState("");

    function makeTitle(event){
        console.log("making title")
    }

    function makeItem(event){
        setItem(event.value)
    }

    return(
    <div className="to-do-list">
        <form>
            <input id="list-title"
            onChange={makeTitle}
            name="item"
            placeholder="List Title"
            />
        </form>
        <br></br>
        <div>
            <form>
            <input
            onChange={makeItem}
            name="item"

            placeholder="Items to add..."
            /> 
            </form>
            <AddButton />

        </div>


        <ul>
            <li>Item 1</li>
            <li>Item 2</li>
        </ul>

    </div>);

}

